import React from 'react';
import './login.css'


const login =(props)=>{
    return (
        <div className='container'>
            <span>Name :</span>
            <input  
            type="text"
            onChange={props.changedName}
            value={props.name}
            ></input>
            <br></br>
            <span>Password :</span>
            <input
            type="password"
            onChange={props.changedPasswrd}
            value={props.Password}  
            ></input>
            <br></br>
            <button onClick ={props.click}>Submit</button>
        </div>
    );
}

export default login;
